import React from 'react';
import { Link } from 'react-router-dom';
const Navigation = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/mybooks">Booking</Link>
                </li>
                <li>
                    <Link to="/favorites">Gallery</Link>
                </li>
            </ul>
        </nav>
    );
};
export default Navigation;
